// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract NFTEscrow {
    
    function test(address _owner, uint256 _idx)
        public
        view
        returns (bytes32 salt, address predictedAddress)
    {

        salt = sha256(abi.encodePacked(_owner));

        bytes memory bytecode;

        //hash from which the contract address can be derived
        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                salt,
                keccak256(bytecode)
            )
        );
    }

    function testOpt(address _owner, uint256 _idx)
        public
        view
        returns (bytes32 salt, address predictedAddress)
    {

        salt = sha256(abi.encodePacked(_owner));

        bytes memory bytecode;

        //hash from which the contract address can be derived
        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                salt,
                keccak256(bytecode)
            )
        );
    }
}

